import { Link } from "react-router-dom";
import {Navbar,NavbarBrand} from 'reactstrap'
function  Header(){
    return     <header>
                   <Navbar dark color="primary">
                <div className="container">
                <NavbarBrand href="/">Home</NavbarBrand>
                </div>
                </Navbar>
                        
                          
                </header>
      
}
export default Header;
